import React from 'react';
import { Container } from "react-bootstrap";
import Row from "react-bootstrap/Row";
import { observer } from "mobx-react-lite";

const Shop = observer(() => {
    return (

        <Container>
            <Row className="mt-2">
                <img src='/images/logo-white.png' alt='paris' />
            </Row>
            <Row className="mt-2">
                <img src='/images/frame.png' alt='paris' />
            </Row>
            <Row className="mt-20">
                <img src='/images/ico-countries.svg' alt='paris' />
            </Row>
            <Row className="mt-2">
                <img src='/images/ico-disciplines.svg' alt='paris' />
            </Row>
        </Container>
    );
});

export default Shop;
